import React from "react";

import Unsplash from "../api/cloud";
import Footer from "../components/footer.js";
import Form from "../components/form.js";
import "../css/App.css";

class Home extends React.Component {
  render() {
    return (
      <div>
        <Form onSubmit={this.onSearchSumbit} />
        <Footer />
      </div>
    );
  }
}

export default Home;
